use jpaas_form;
CREATE TABLE `sys_nation_area` (
  `ID_` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
  `NATION_` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '国家简称',
  `AREA_CODE_` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '地区代码',
  `AREA_NAME_` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '地区名称',
  `AREA_NAME_PY_` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '地区名称拼音',
  `AREA_LEVEL_` tinyint(3) NOT NULL COMMENT '地区级别',
  `PROVINCE_` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '省份',
  `CITY_` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '城市',
  `COUNTY_` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '县级',
  `RANK_` int(10) NOT NULL COMMENT '排序，值越大越前',
  `STATUS_` tinyint(3) NOT NULL COMMENT '状态，[1:显示, 2:隐藏]',
  `PARENT_CODE_` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '所属地区',
  PRIMARY KEY (`ID_`) USING BTREE
)   COMMENT='地区表';

-- ----------------------------
-- Records of sys_nation_area
-- ----------------------------
commit;
